import React, { Component } from 'react';

class MovieDetails extends Component {
    state = {
        id: null
    }

    componentDidMount() {
        let id = this.props.match.params.movieId;
        this.setState({
            id: id
        })
    }

    render() {
        return (
            <div>
                <h4>{this.state.id}</h4>
            </div>
        )
    }
}

export default MovieDetails;
